import "./TopBar.css";
const TopBar = () => {
  return (
    <div className="top">
      <div className="top-left">
        <i class="fab fa-facebook" />
        <i class="fab fa-twitter" />
        <i class="fab fa-instagram" />
        <i class="fab fa-linkedin-in" />
      </div>
      <div className="top-center">c</div>
      <div className="top-right">r</div>
    </div>
  );
};
export default TopBar;
